export const Feedback = onAddFeedback => {
  return (
    // <Section>
    //   <Title>Please leave feedback</Title>
    <div>
      <button type="button" onClick={onAddFeedback}>
        Good
      </button>
      <button type="button" onClick={onAddFeedback}>
        Neutural
      </button>
      <button type="button" onClick={onAddFeedback}>
        Bad
      </button>
    </div>
    // </Section>
  );
};
